import React, { useState } from 'react';

import { Navbar, Header, Intro, AboutUs, FindUs, Footer, Gallery, Laurels, SpecialMenu, Graph1 } from './container';
import './App.css';
import { UserData } from './constants/Data';

const App = () => {

  const [ userData, setUserData ] = useState({
    labels: UserData.map((data) => (data.y)),
    datasets: [{
      label: "PRINCE IN ETH",
      data: UserData.map((data) => (data.x)),
    }]
  });



  <div>
    <Navbar />
    <Header />
    <Intro />
    <AboutUs />
    <SpecialMenu />
    <Graph1 className='graph1' chartData={userData}/>
    <Laurels />
    <Gallery />
    <FindUs />
    <Footer />
  </div>
};

export default App;
